import React from "react";

import "./tgButton.css";

const tgButton = () => {
    const styles = {
        margin: "0px"
    };

    return (
        <div class="form-group">
            <label for="exampleFormControlFile1">Example file input</label>
            <label style={styles}> 
                <input className="tg-btn__checkbox" type="checkbox"/>
                <div className="tg-btn">
                    <span className="tg-btn__slider"></span>
                </div>
            </label>
        </div>
    );
}

export default tgButton;
